func Test_GetStockAnalysis(t *testing.T) {
	res, err := GetStockAnalysis(time.Date(2023, 11, 21, 0, 0, 0, 0, time.UTC))
	if err != nil {
		log.Fatalln(err)
	}

	fmt.Println(res)
}

func Test_CompanyStockAnalysis(t *testing.T) {
	payload := &CompanyStockAnalysis{}
	if err := json.Unmarshal([]byte(mock_StockAnalysis), payload); err != nil {
		log.Fatalln(err)
	}

	for _, data := range payload.Data {
		stock := &stockdao.Company_stock_analysis{
			Date:                payload.Date,
			Company_id:          data[0].(string),
			Company_name:        data[1].(string),
			Yield:               toFloat32(data[2]),
			Yield_year:          fmt.Sprint(data[3]),
			PE:                  toFloat32(data[4]),
			PBR:                 toFloat32(data[5]),
			Analysis_year_month: data[6].(string),
		}
		fmt.Println(stock)
	}

}

